import * as React from 'react';

const Test: React.FC = () => {
  return (
    <>
      <div>てすと</div>
      <h1>Counter</h1>
      <h2>カウント: ここにカウンタ数表示</h2>
      <button>+</button>
      <button>-</button>
    </>
  );
};

export default Test;
